import React from "react";
import logo from "./logos/logo.png";
import RecycleBin from "./Recyclebin";

const Header = () => {
    return <>

        <div className="header">
            <img src={logo} alt="Logo" width="120px"/>
            <button> {bin} </button>
        </div>

    </>

};
 
export {Header, RecycleBin};
